import React from "react";

export default () => {
  return (
    <div className="link-ctn">
      <div className="main">
        <div className="color"></div>
        <h2>CSS</h2>
      </div>
      <ul className="site-list">
        <li>
          <div className="backcolor">
            <h3>UI 参考网站 -- dribbbie</h3>
          </div>
        </li>
      </ul>
      <style jsx>{`
        .link-ctn {
          width: 80%;
          margin: 0 auto;
          background: #212329;
          display: flex;
          padding: 10px;
          border-radius: 6px;
        }
      `}</style>
    </div>
  );
};
